import React from 'react';
import {Link} from 'react-router-dom'

const Header=()=>(
  <div>
  <ul>
    <li><Link to="/component1">component1</Link></li>
    <li><Link to="/component2">component2</Link></li>
    {/* <li><Link to="/component3">component3</Link></li> */}
  </ul>
  </div>  
)

export default Header;
